import React from "react";

function Resources() {
    return (
        <div className="resources">
            <h2>Resources</h2>
            <p> <a href="https://www.nytimes.com/guides/well/how-to-meditate">Mindful.org</a> - Meditation is a simple practice available to all, which can reduce stress, increase calmness and clarity and promote happiness. Learning how to meditate is straightforward, and the benefits can come quickly. Here, we offer basic tips to get you started on a path toward greater equanimity, acceptance and joy. Take a deep breath, and get ready to relax.</p>

        </div>
    )
}

export default Resources
